import { Provider } from "react-redux";

import store from "./store";
import { CreateTodo, TodosList,TagList} from "./components";

function App() {
  return (
    <Provider store={store}>
      <div className="App">
        <CreateTodo />
        <TodosList />
        <TagList/>
      </div>
    </Provider>
  );
}

export default App;
